description:
The movie starts off with the family heading to a ski lodge in Colorado. When they get to their condo, they find Belinda's brother and his son staying in the same condo. Along with the boys was a poodle named Bella, and Zeus immediately has a crush on her. Despite the surprised guests there, George tries to have the best Christmas ever.

Meanwhile, Ted and Stewey are after London James' necklace, so they steal it, but they accidentally leave it at the gift shop, where Gary lets Zeus buy it for Bella. Ted and Stewey kidnap Bella, so Zeus goes after her. The family finds the dogs at the village. London James gets her necklace back, Ted and Stewey are arrested, and Zeus and Bella becomes a couple.






